import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { withRouter } from "react-router";
import 'containers/Setlists/Setlists.css';
import Spinner from 'components/UI/Spinner/Spinner';

class Setlists extends Component {
       constructor(){
                super();
                this.state = {
                    artistName: '',
                    loading: false
        }} 

        componentDidMount() {
            this.setState({artistName: this.props.location.state.artistName});
            if(this.props.location.state.artistName){
                fetch('/api/artistSetlists?artist=' + encodeURIComponent(this.props.location.state.artistName))
                .then((response => {
                    console.log(response)
                }))
                .catch((error => {
                    console.log(error);
                }))
            }
        }

        render () {
            let results = null;
            if(this.state.loading){
                results = <Spinner />
            }
        return(

<Container className = "setlists-section" fluid>
        {results}
</Container>
                )       
        }
    }

export default withRouter(Setlists);
